import React from 'react';

import './LoginPage.css';

function LoginPage () {

  return(
    <div className = "login-container">
      <input 
        placeholder = "username"
        className = "login-input"
      />
      <input 
        type = "password" 
        placeholder = "password"
      />
      <button>Login</button>
    </div>
  )
}

export default LoginPage;
